import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Image()
{
  const [path, setPath] = useState('');

  useEffect(() => {
    fetch("/picture").then(res =>  
    res.json().then(data => setPath(data.path))
  )},[]);

  return(
    <header class="App-header">
      <h1>inkn</h1>
      <p>Path: {path}</p>
    </header>

  );
}

function Sup()
{
  const [path, setPath] = useState('');

  useEffect(() => {
    fetch("/picture").then(res =>  
    res.json().then(data => setPath(data.path))
  )},[]);

  return (
    <header class="App-header">
        <h1>sup</h1>
        <div>
          {path}
          <img href="/"></img>
        </div>
    </header>
  );
}


export default function Bull(){
  return (
    <header>
      <div><Sup /></div>
      <Image />
    </header>

  );

}
